// 반복 함수
// 0~9
function createDotmatrixNumberMenu() {
    let menu = [];
    for(let i = 0; i <= 9; i++) {
        menu.push({
            text: String(i),
            value: i
        });
    }
    return menu;
}

// a~z
function createDotmatrixSmallLetterMenu() {
    let menu = [];
    for(let i = 97; i <= 122; i++) {
        let char = String.fromCharCode(i);
        menu.push({
            text: char,
            value: char
        });
    }
    return menu;
}

// A~Z
function createDotmatrixCapitalLetterMenu() {
    let menu = [];
    for(let i = 65; i <= 90; i++) {
        let char = String.fromCharCode(i);
        menu.push({
            text: char,
            value: char
        });
    }
    return menu;
}

// 가~하
function createDotmatrixKoreanLetterMenu() {
    let menu = [];
    const koreanLetters = ['가', '나', '다', '라', '마', '바', '사', '아', '자',
        '차','카','타','파','하'];

    for(let i = 0; i < koreanLetters.length; i++) {
        let char = koreanLetters[i];
        menu.push({
            text: char,
            value: char
        });
    }
    return menu;
}

